import React, {forwardRef} from 'react'

const AboutUsChild = (props, ref) => {

  return (
    <div>
      <h1>About Us Form</h1>
      <form>
        <label htmlFor="firstName">First Name</label>
        <input id="firstName" type="text" ref={ref} />
      </form>
    </div>
  )
}

export default forwardRef(AboutUsChild)
